import React from 'react'
import './css/About.css'

function About() {
  return (
    <div className='App-About'>
        <h1>About</h1>
        <p>Get ready the for Mallareddy University's ultimate 24-hour hackathon! Brace yourselves for an endless journey filled with code, creativity, and teamwork. We're talking about an incredible occasion where your ideas, driven by excitement and a desire for creativity, take center stage. It's a journey where you can make your most ambitious tech aspirations come true, not just a hackathon. It's more than a hackathon; it's a journey where you can turn your wildest tech dreams into reality. So grab a seat, because Mallareddy University is the heart of a revolution in coding for the next 24 hours!
        #MallareddyHackathon #CodeOn</p>
    </div>
  )
}

export default About
